import React from 'react';
import logo from './logo.svg';
import {BrowserRouter,Routes,Route} from 'react-router-dom';
import './App.css';
import { Admin_Dashboard,User_Dashboard,Saler_Dashboard } from './helpers/permissions';
import Login from './components/Login.component';
import PublicRoutes from './components/middlewares/PublicRoutes.component.js';
import ProtectedRoutes from './components/middlewares/ProtectedRoutes.component';
import AdminDashboard from './components/admin/adminDashboard.component';
import UserDashboard from './components/user/userDashboard.component.js';
import SalerDashboard from './components/saler/salerDashboard.component';
import Dashboard from './components/middlewares/Dashboard.component';
import Cart from './components/user/cart/cart.component.js';
import { Elements } from '@stripe/react-stripe-js';
import { loadStripe } from '@stripe/stripe-js';
import PaymentComponent from './components/PaymentComponent.js';

const stripePromise = loadStripe('YOUR_STRIPE_PUBLIC_KEY');

function App() {
  return (
      <BrowserRouter>
        <Routes>
          <Route element={<PublicRoutes />}>
            <Route path='/' element={<Login />}/>
            <Route path='/login' element={<Login />}/>
          </Route>
          <Route element={<ProtectedRoutes/>}>
              <Route element={<Dashboard permission={Admin_Dashboard}/>} >
                <Route path='/admin-dashboard' element={<AdminDashboard />} />
              </Route>

              <Route element={<Dashboard permission={Saler_Dashboard} />} >
                <Route path='/saler-dashboard' element={<SalerDashboard />} />
              </Route>

              <Route element={<Dashboard permission={User_Dashboard} />} >
                <Route path='/user-dashboard' element={<UserDashboard />} />
                <Route path='/cart' element={<Cart/>} />
              </Route>     
          </Route>
        </Routes>
        {/* <Elements stripe={stripePromise}>
          <PaymentComponent amount={50} />
        </Elements> */}
      </BrowserRouter>
  );
}

export default App;
